<br><br>



<br><br>

<br><br>

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
LaLaBEAUTY　ララビューティー3D美顔ローラー<br>
<br>
3D美顔ローラー「LaLaBEAUTY(ララビューティー)」<br>
Y字型とダイヤカットでマッサージのような効果で毛穴引き締め、美肌をサポート。<br>
ハンディサイズの美顔器なので細かいフェイスパーツもマッサージ。<br>
マッサージローラーとして二の腕、ウエスト、ヒップ、ふくらはぎ、足にも使えます。<br>
<br>
【特徴】<br>
・マッサージ3D美顔ローラー<br>
・お肌の上を3分つまみながら転がすだけの簡単マッサージ。<br>
・独自のY字型構造設計でエステのようなマッサージ感<br>
・ダイヤカットのマッサージボールがタッピング効果で血行促進<br>
・持ちやすいエルゴノミクスデザインのハンドル<br>
・完全防水設計でバスタイムや化粧水をつけたお肌にも使える。<br>
・顔、二の腕、ウエスト、ヒップ、ふくらはぎ、足など様々な部位に使えます。<br>
<br>
独自のY字型特殊設計+ダイヤカットのマッサージボールがフェイスやボディにやさしくフィット。<br>
細やかなダイヤ形状が複数のマッサージポイントを生み出し、お肌をタッピング、血行を促進します。<br>
お顔だけでなく気になるボディのお肉もグイグイつまみあげ、マッサージします。<br>
持ちやすいハンドルはエルゴノミクスデザイン。疲れにくく実用性のあるハンドルです。<br>
ハンディサイズなので小回りが効き、目元や口元など、お顔の細かいパーツにもピッタリ。<br>
お風呂場に持ち込んでも安心の完全防水設計。化粧水をつけたお顔や、バスタブの中での使用もOKで、<br>
リラックスタイムをさらに効果的に♪<br>
一日3分転がすだけの簡単エステ！<br>
<br>
安心設計＆安心価格＆安心保障（1年保証）<br>
３つの安心を約束！<br>
<br>
規格<br>
サイズ：約H105×W53×D32cm<br>
重さ：約107g <br>
素材：ABS/亜鉛合金/クロムメッキ<br>
セット内容：本体×1,取扱説明書・保証書×1,<br>
<br>
※ご使用は1日につき3回、同じ箇所には３分までとしてください。 <br>
※やさしく適度な力でご使用ください。力を入れすぎるとお肌を傷つけるおそれがあります。<br>
※衣服の上から使用すると、衣服を損傷するおそれがあります。 <br>
※ご使用後にお肌が赤くなることがありますが、これはマッサージによるものなの で正常です。<br>
　しばらくたっても消えない場合(個人差があります)、翌日になって も消えない場合は使用を中止し、医師にご相談<br>
　ください。 <br>
